import {
  GraphQLObjectType,
  GraphQLString,
  GraphQLBoolean,
  GraphQLSchema,
  GraphQLList
} from "graphql";
import {
  findIDAndDelete,
  generateUniqueID,
  findIDandDone,
  findIDAndEdit
} from "./helpler";
import { Todo } from "./interface.type";

export const TodoType = new GraphQLObjectType({
  name: "Todo",
  fields: () => ({
    id: { type: GraphQLString },
    task: { type: GraphQLString },
    done: { type: GraphQLBoolean }
  })
});

export let todoMocking = [
  {
    id: "1",
    task: "Cleaning",
    done: false
  },
  {
    id: "2",
    task: "Writing",
    done: false
  },
  {
    id: "3",
    task: "Reading",
    done: false
  }
];

const queryType = new GraphQLObjectType({
  name: "Query",
  fields: () => ({
    allTodos: {
      type: new GraphQLList(TodoType),
      resolve() {
        return todoMocking;
      }
    },
    todo: {
      type: TodoType,
      args: { id: { type: GraphQLString } },
      resolve(parentValue, args, context, info) {
        return todoMocking.find(todo => todo.id === args.id);
      }
    }
  })
});

const EditResponseType = new GraphQLObjectType({
  name: "EditResponseType",
  fields: () => ({
    successed: { type: GraphQLBoolean },
    message: { type: GraphQLString }
  })
});

const FinishTaskResponseType = new GraphQLObjectType({
  name: "FinishTaskResponseType",
  fields: () => ({
    successed: { type: GraphQLBoolean }
  })
});

const DeletedResponseType = new GraphQLObjectType({
  name: "DeletedResponse",
  fields: () => ({
    message: { type: GraphQLString },
    isDelete: { type: GraphQLBoolean }
  })
});

const rootMutation = new GraphQLObjectType({
  name: "Mutation",
  fields: {
    addTodo: {
      type: TodoType,
      args: { task: { type: GraphQLString } },
      resolve(_, { task }): Todo {
        const generatedID = generateUniqueID();
        const newTodo: Todo = { id: generatedID, task, done: false };
        todoMocking.push(newTodo);
        return newTodo;
      }
    },
    removeTodo: {
      type: DeletedResponseType,
      args: { id: { type: GraphQLString } },
      resolve(parentValue, { id }) {
        const isIDExist = todoMocking.find(todo => todo.id === id);
        if (isIDExist === undefined) {
          return { message: "TODO ID does not exists!", isDelete: false };
        }
        const newTodo = findIDAndDelete(id, todoMocking);
        todoMocking = newTodo;
        return { message: "Delete Successed", isDelete: true };
      }
    },
    finishTask: {
      type: FinishTaskResponseType,
      args: { id: { type: GraphQLString } },
      resolve(_, { id }) {
        const newListOfTodo = findIDandDone(id, todoMocking);
        if (newListOfTodo) {
          todoMocking = newListOfTodo;
          return { successed: true };
        }
        return { successed: false };
      }
    },
    editTask: {
      type: EditResponseType,
      args: { id: { type: GraphQLString }, task: { type: GraphQLString } },
      resolve(_, { id, task }) {
        const newListTodo = findIDAndEdit(id, task, todoMocking);
        if (newListTodo) {
          todoMocking = newListTodo;
          return {
            message: `todo has been changed`,
            successed: true
          };
        }
        return { message: "ID does't exists", successed: false };
      }
    }
  }
});

const rootSchema = new GraphQLSchema({
  query: queryType,
  mutation: rootMutation
});

export { rootSchema };
